    END,
    updatedat = NOW()
    WHERE symbol IN ('ECML', 'GIAX', 'PZA', 'RNWZ', 'EZA', 'PHYD', 'SCHQ', 'QVMS', 'SIFI', 'VNSE', 'MTGP', 'MGNR', 'KSA', 'QQQS', 'SMMV', 'IYC', 'DOO', 'LQAI', 'SSO', 'ZHDG');